import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import LoginPage from './pages/LoginPage';
import CitySelectionPage from './pages/CitySelectionPage';
import RoomBookingPage from './pages/RoomBookingPage';
import RestaurantOrdersPage from './pages/RestaurantOrdersPage';
import HotelFacilitiesPage from './pages/HotelFacilitiesPage';
import CheckoutPage from './pages/CheckoutPage';
import BranchStaffDashboard from './pages/BranchStaffDashboard';
import FloorPlanPage from './pages/FloorPlanPage';
import AdminDashboard from './pages/AdminDashboard';
import BranchSelectionPage from './pages/BranchSelectionPage';
import StatisticsPage from './pages/StatisticsPage';

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/" exact component={LoginPage} />
                <Route path="/city-selection" component={CitySelectionPage} />
                <Route path="/room-booking" component={RoomBookingPage} />
                <Route path="/restaurant-orders" component={RestaurantOrdersPage} />
                <Route path="/hotel-facilities" component={HotelFacilitiesPage} />
                <Route path="/checkout" component={CheckoutPage} />
                <Route path="/branch-staff-dashboard" component={BranchStaffDashboard} />
                <Route path="/floor-plan" component={FloorPlanPage} />
                <Route path="/admin-dashboard" component={AdminDashboard} />
                <Route path="/branch-selection" component={BranchSelectionPage} />
                <Route path="/statistics" component={StatisticsPage} />
            </Switch>
        </Router>
    );
};

export default App;
